import { useNavigate } from "react-router-dom";
import BuyButton from "./button";

const Success = () => {
  const navigate = useNavigate();

  const MoveToHomes = () => {
    navigate("/checkout");
  };
  return (
    <div>
      <h1>Success</h1>
      <h2>Thank you for your purchase!</h2>
      <BuyButton label='Return to Home' onClick={() => MoveToHomes()} />
    </div>
  );
};

export default Success;
